&> (aktualizované: <UPDATE_DATE&&>).'),('schedule_based_on_who','sl','Urnik cepljenj temelji na trenutnih priporočilih <WHO_LINK_START&&>WHO<WHO_LINK_END&&> za <COUNTRY_NAME&&> (posodobljeno <UPDATE_DATE&&>).'),('schedule_based_on_who','sv','Vaccinations-schemat är baserat på nuvarande <WHO_LINK_START&&>WHO<WHO_LINK_END&&> rekommendationer för <COUNTRY_NAME&&> (uppdaterad<UPDATE_DATE&&>).'),('schedule_based_on_who','ta','<COUNTRY_NAME&&> -க்கான தற்போதைய  <WHO_LINK_START&&>WHO<WHO_LINK_END&&> பரிந்துரைகளின் அடிப்படையில் இந்த தடுப்பூசி அட்டவணை உள்ளது (மேம்படுத்தப்பட்டது <UPDATE_DATE&&>).'),('schedule_based_on_who','te','టీకాల ప్రణాలిక ప్రస్తుత  <WHO_LINK_START&&>WHO<WHO_LINK_END&&> సిఫారస్సుల మేరకు చేస్తున్నాము <COUNTRY_NAME&&> (అప్డేట్ చేయబడింది<UPDATE_DATE&&>).'),('schedule_based_on_who','tr','Aşı takvimi <COUNTRY_NAME&&> için güncel <WHO_LINK_START&&>WHO<WHO_LINK_END&&> önerileri baz alınarak hazırlanmıştır (güncellendi <UPDATE_DATE&&>).'),('schedule_based_on_who','ur','موجودہ ویکسینیشن شیڈول <WHO_LINK_START&&>عالمی ادارہ صحت<WHO_LINK_END&&> کے سفارش کردہ کے موجودہ شیڈول پر بنیاد رکھتا ہے بمتعلق ملک <COUNTRY_NAME&&> (updated <UPDATE_DATE&&>).'),('schedule_based_on_who','vi','Lịch tiêm phòng dựa trên khuyến cáo hiện nay của <WHO_LINK_START&&>WHO<WHO_LINK_END&&> cho <COUNTRY_NAME&&> (cập nhật ngày <UPDATE_DATE&&>).'),('schedule_based_on_who','zh','此疫苗接种方案根据现行的<WHO_LINK_START&&>世界卫生组织（WHO）<WHO_LINK_END&&>针对<COUNTRY_NAME&&>的接种建议(更新于<UPDATE_DATE&&>)。'),('schedule_for_country_consult','ar','ويستند جدول التطعيم على التوصيات الحالية لمنظمة الصحة العالمية لدولة <COUNTRY_NAME&&> . استشر دوما طبيبك الصحي المحلي حول ما إذا كانت التطعيمات الأخرى تنطبق على منطقتك.'),('schedule_for_country_consult','ca','El calendari de vacunació es basa en les recomanacions actuals de l\'OMS per a <COUNTRY_NAME&&>. Consulta sempre amb el teu metge de salut local per si existeixen d\'altres vacunes a la teva regió.'),('schedule_for_country_consult','cs','Časový rozpis vakcinací je založen na současném doporučení WHO pro zemi <COUNTRY_NAME&&>. Vždy se poraďte s místním praktickým lékařem, zdali se na vaši oblast nevztahují i další vakcinace.	'),('schedule_for_country_consult','da','Vaccinationsplanen er baseret på de nuværende WHO-anbefalinger for <COUNTRY_NAME&&>. Rådfør dig altid med din lokale læge vedrørende vaccinationer som gælder for din region.'),('schedule_for_country_consult','de','Der Impfplan basiert auf den aktuellen Empfehlungen der WHO für <COUNTRY_NAME&&> . Konsultieren Sie immer Ihren lokalen Arzt, ob andere Impfungen für Ihre Region anwendbar sind.'),('schedule_for_country_consult','el','Το πρόγραμμα εμβολιασμού βασίζεται στις τρέχουσες συστάσεις του ΠΟΥ για <COUNTRY_NAME&&> . Θα πρέπει πάντα να συμβουλεύεσαι τον γιατρό σου για το εάν ισχύουν και άλλοι εμβολιασμοί για την περιοχή σου.'),('schedule_for_country_consult','en','The vaccination schedule is based on the current WHO recommendations for <COUNTRY_NAME&&>. Always consult with your local health practitioner whether any other vaccinations may be applicable for your region.'),('schedule_for_country_consult','es','El calendario de vacunas está basado en las recomendaciones actuales de la OMS para <COUNTRY_NAME&&>. Consulta con tu médico sobre otras vacunas recomendadas en tu zona.\n'),('schedule_for_country_consult','fi','Rokoteohjelma perustuu WHO:n tämänhetkisiin maassasi <COUNTRY_NAME&&> suosittelemiin rokotuksiin. Kysy aina paikallisilta terveysalan ammatilaisilta, onko alueellasi suositeltu joitain muita rokotteita.'),('schedule_for_country_consult','fr','Le calendrier de vaccination est basé sur les recommandations actuelles de l\'OMS <COUNTRY_NAME&&> . Consultez toujours votre professionnel de la santé local pour savoir si d\'autres vaccins peuvent s\'appliquer dans votre région.'),('schedule_for_country_consult','gu','આ રસીકરણ શેડ્યૂલ વર્તમાન ડબ્લ્યુએચઓ ભલામણો પર આધારિત છે<દેશ_નામ&&>. હંમેશા તમારા સ્થાનિક સ્વાસ્થ્ય વ્યવસાયી સાથે સંપર્ક કરો કે પછી કોઈપણ અન્ય રસીકરણ તમારા પ્રદેશ માટે લાગુ થઈ શકે છે.'),('schedule_for_country_consult','he','לוח החיסונים מבוסס על המלצות ארגון הבריאות העולמי הנוכחיות עבור <&&COUNTRY_NAME>. יש להתייעץ תמיד עם רופא הבריאות המקומי שלך באם קיימים חיסונים אחרים רלוונטים באזור שלך.'),('schedule_for_country_consult','hi','टीकाकरण शिड्यूल <COUNTRY_NAME &&> के लिए WHO की मौजूदा सिफ़ारिशों पर आधारित है। हमेशा अपने स्थानीय स्वास्थ्य व्यवसायी से सलाह लें कि क्या आपके क्षेत्र के लिए कोई अन्य टीके लागू होते हैं या नहीं।'),('schedule_for_country_consult','hr','Raspored cijepljenja temelji se na aktualnim preporukama SZO-a za <COUNTRY_NAME&&>. Uvijek se posavjetujte sa svojim lokalnim liječnikom opće prakse o tome mogu li se druga cijepljenja primijeniti ​​za vašu regiju.'),('schedule_for_country_consult','hu','Az oltási ütemterv a WHO jelenlegi ajánlásai alapján készült <COUNTRY_NAME&&> államához. Mindig konzultáljon a helyi egészségügyi szakemberével arról, hogy más oltások elérhetőek-e a régiójában.'),('schedule_for_country_consult','ka','ಲಸಿಕೆ ವೇಳಾಪಟ್ಟಿ <COUNTRY_NAME&&> ದೇಶಕ್ಕೆ ವಿಶ್ವ ಆರೋಗ್ಯ ಸಂಸ್ಥೆಯ ಪ್ರಸ್ತುತ ಸೂಚನೆಗಳನ್ನು ಆಧರಿಸಿದೆ. ನಿಮ್ಮ ಪ್ರದೇಶಕ್ಕೆ ಇತರ ಲಸಿಕೆಗಳು ಅನ್ವಯವಾಗುತ್ತದೆಯೇ ಎಂದು ತಿಳಿಯಲು ಯಾವತ್ತೂ ನಿಮ್ಮ ಸ್ಥಳೀಯ ವೈದ್ಯರೊಡನೆ ಸಮಾಲೋಚಿಸಿ.'),('schedule_for_country_consult','ko','백신 접종 스케줄은 현재 WHO 권고안 <COUNTRY_NAME&&> . 해당 지역의 다른 예방 접종이 가능한지 여부는 해당 지역 보건 종사자에게 항상 문의하십시오.'),('schedule_for_country_consult','mr','लसीकरण वेळापत्रक हे WHO द्वारे <COUNTRY_NAME&&> साठी करण्यात आलेल्या वर्तमान शिफारसींवर आधारित आहे. आपल्या प्रदेशासाठी इतर कोणते लसीकरण लागू होऊ शकते का याबाबत नेहमी आपल्या स्थानिक आरोग्य तज्ज्ञांचा सल्ला घ्या.'),('schedule_for_country_consult','ms','Jadual vaksinasi ini adalah berdasarkan saranan semasa daripada WHO untuk negara <COUNTRY_NAME&&>. Dapatkan nasihat daripada pengamal kesihatan di tempat anda tentang vaksinasi lain yang mungkin diperlukan di kawasan anda.'),('schedule_for_country_consult','nl','Het vaccinatieschema is gebaseerd op de huidige WHO-aanbevelingen voor <COUNTRY_NAME&&> . Overleg altijd met je eigen huisarts of er tevens andere vaccinaties van toepassing kunnen zijn voor jouw regio.'),('schedule_for_country_consult','no','Vaksinasjonsplanen er basert på dagens WHO-anbefalinger for <COUNTRY_NAME&&> . Rådfør deg alltid med din fastlege om hvorvidt andre vaksiner kan gjelde for din region.'),('schedule_for_country_consult','pl','Harmonogram szczepień jest oparty na aktualnych zaleceniach WHO dla <COUNTRY_NAME&&> . Zawsze należy skonsultować się z lokalnym lekarzem, czy inne szczepienia mogą dotyczyć Twojego regionu.'),('schedule_for_country_consult','pt','O cronograma de vacinação é baseado nas recomendações atuais da OMS para <COUNTRY_NAME &&>. Sempre consulte seu médico local para verificar se outras vacinas são aplicáveis ​​para sua região.'),('schedule_for_country_consult','sk','Očkovanie sa zakladá na aktuálnych odporúčania organizácie WHO pre krajinu <COUNTRY_NAME&&>. Vždy sa poraďte so svojím miestnym lekárom a zistite tak, či sa vo vašom regióne môže vyžadovať aj nejaké ďalšie očkovanie.'),('schedule_for_country_consult','sv','Vaccinationsschemat är baserat på WHOs nuvarande rekommendationer för <COUNTRY_NAME&&>. Rådgör alltid med din lokala vårdcentral om andra vaccinationer kan vara nödvändiga för din region.'),('schedule_for_country_consult','ta','<COUNTRY_NAME&&> -க்கான தற்போதைய WHO பரிந்துரைகளின் அடிப்படையில் இந்த தடுப்பூசி அட்டவணை உள்ளது. உங்கள் பகுதியில் பிற எந்தவித தடுப்பூசிகளும் பொருந்தக்கூடியதா என்பது குறித்து எப்போதும் உங்கள் உள்ளூர் மருத்துவரை ஆலோசிக்கவும்.'),('schedule_for_country_consult','te','ఈ టీకా ప్రణాళిక డబ్ల్యు హెచ్ ఓ <COUNTRY_NAME&&> కోసం ప్రస్తుతం సిఫారస్సుకు ఆధారం చేసుకున్నాం. మీ ప్రాంతానికి వేరే ఇతర టీకాలు వర్తిస్తాయని ఎప్పుడూ స్థానిక హేల్త్ ప్రాక్టీషనర్ ను సంప్రదించండి. '),('schedule_for_country_consult','tr','Aşı takvimi WHO\'nun <COUNTRY_NAME&&> için güncel önerileri baz alınarak hazırlanmıştır. Aşıların bölgeniz için uygulanabilir olup olmadığını her zaman yerel sağlık kuruluşlarına danışın.'),('schedule_for_country_consult','ur','موجودہ ویکسینیشن شیڈول عالمی ادارہ صحت کے سفارش کردہ شیڈول پر بنیاد رکھتا ہے بابت ملک      <COUNTRY_NAME&&>. ہمیشہ اپنے مقامی عمومی معالج صحت سے مشورہ کریں کہ آیا آپ کے علاقے کے لیے مزید کسی ویکسین کا لگوایا جانا باقی ہے.'),('schedule_for_country_consult','vi','Lịch tiêm phòng dựa trên khuyến cáo hiện tại của WHO dành cho <COUNTRY_NAME&&>. Hãy luôn trao đổi với y bác sĩ địa phương của bạn về việc có mũi tiêm phòng nào khác có thể áp dụng cho khu vực của bạn không.'),('schedule_for_country_consult','zh','疫苗接种方案基于现行的世界卫生组织（WHO）针对<COUNTRY_NAME&&>的建议。请首先咨询当地保健医生了解其他疫苗是否适用您所在的地区。'),('share_others_signup','ar','هل تعتقد أن هذا التذكير بالتطعيمات قد يكون مفيدا أيضا لأصدقائك، إذا كان الأمر كذلك أرجو أن تخبرهم أنه يمكنهم الاشتراك في <WEB_NAME&&> في أقل من 10 ثواني وأنه 100٪ مجانا.'),('share_others_signup','ca','Creus que aquests recordatoris de vacunació poden ser útils també per als teus amics? Si és així, fes-los saber que poden inscriure\'s en menys de 10 segons a <WEB_NAME&&> i que el servei és 100% gratuït.'),('share_others_signup','cs','Myslíte si, že by tyto připomenutí očkování mohly být užitečné také vašim přátelům? Pokud ano, dejte jim vědět, že se mohou zaregistrovat za méně než 10 sekund na <WEB_NAME&&> a že je to 100% zdarma.'),('share_others_signup','da','Tror du disse vaccinationspåmindelser også kunne være nyttige for dine venner? hvis, så lad dem vide, at de kan tilmelde sig på mindre end 10 sekunder hos <WEB_NAME&&>, og det er 100% gratis.'),('share_others_signup','de','Denkst du, dass diese Impfungserinnerungen auch für deine Freunde nützlich sein könnte, wenn Sie sie wissen lassen, dass sie sich in weniger als 10 Sekunden bei <WEB_NAME&&> anmelden können und es 100% kostenlos ist?'),('share_others_signup','el','Πιστεύεις ότι αυτές οι υπενθυμίσεις εμβολιασμού θα μπορούσαν να είναι χρήσιμες και για τους φίλους ή συγγενείς σου; Αν ναι, ενημέρωσέ τους ότι μπορούν να εγγραφούν σε λιγότερο από 10 δευτερόλεπτα στο <WEB_NAME&&>. Η εγγραφή είναι 100% δωρεάν.'),('share_others_signup','en','Do you think these vaccination reminders could be useful for your friends too? If so let them know that they can signup in less than 10 seconds at <WEB_NAME&&> and it is 100% free.'),('share_others_signup','es','¿Crees que a tus amigos les serían útiles estos recordatorios para las vacunas?. Si es así, hazles saber que pueden inscribirse en menos de 10 segundos en <WEB_NAME&&> y que es 100% gratuito.'),('share_others_signup','fi','Uskotko, että rokotemuistutuksista olisi hyötyä myös ystävillesi? Kerrothan heille, että <WEB_NAME&&>-sivulle liittyminen vie vähemmän kuin 10 sekuntia ja se on täysin ilmaista.'),('share_others_signup','fr','Pensez-vous que ces rappels de vaccin pourraient être utiles aussi pour vos amis, si c\'est le cas, faites-leur savoir qu\'ils peuvent s\'inscrire en moins de 10 secondes sur <WEB_NAME&&> et que c\'est 100% gratuit.'),('share_others_signup','gu','શું તમને લાગે છે કે આ રસીકરણ રીમાઇન્ડર્સ તમારા મિત્રો માટે પણ ઉપયોગી થઈ શકે છે? જો એમ હોય તો તેમને જણાવો કે તેઓ <WEB_NAME&&> પર 10 સેકંડથી ઓછા સમયમાં સાઇન અપ કરી શકે છે અને તે 100% મફત છે.'),('share_others_signup','he','האם אתה חושב שהתראות חיסונים אלה יכולים להיות שימושיים גם עבור החברים שלך, אם כן עדכן אותם שניתן להירשם בתוך פחות מ-10 שניות ב-<WEB_NAME&&> וזה לגמרי בחינם.'),('share_others_signup','hi','क्या आपको लगता है कि ये टीकाकरण अनुस्मारक आपके दोस्तों के लिए भी उपयोगी हो सकते हैं? यदि ऐसा है तो उन्हें बताएं कि वे <WEB_NAME&&> पर 10 सेकंड से कम समय में साइन-अप कर सकते हैं और यह 100% नि:शुल्क है।'),('share_others_signup','hr','Mislite li da bi ovi podsjetnici na cijepljenje mogli biti korisni i za vaše prijatelje? Ako mislite, obavijestite ih da se mogu prijaviti za manje od 10 sekundi na <WEB_NAME&&> i da je 100 % besplatno.'),('share_others_signup','hu','Ha úgy gondolja, hogy ezek az oltási emlékeztetők hasznosak lehetnek ismerőseinek is, szóljon nekik, hogy kevesebb mint 10 másodperc alatt regisztrálhatnak a <WEB_NAME&&>-on, ami teljesen ingyenes:'),('share_others_signup','ka','ಈ ಲಸಿಕಾ ಜ್ಞಾಪನೆಗಳು ನಿಮ್ಮ ಸ್ನೇಹಿತರಿಗೆ ಉಪಯೋಗವಾಗಬಹುದೆಂದು ನೀವು ಭಾವಿಸುತ್ತೀರಾ? ಹಾಗಿದ್ದಲ್ಲಿ ಅವರು <WEB_NAME&&> ನಲ್ಲಿ 10 ಸೆಕೆಂಡುಗಳಿಗಿಂತಲೂ ಕಡಿಮೆ ಅವಧಿಯಲ್ಲಿ ಪೂರ್ತಿ ಉಚಿತವಾಗಿ ಸೈನ್ ಅಪ್ ಮಾಡಬಹುದು ಎಂದು ಅವರಿಗೆ ತಿಳಿಸಿ.'),('share_others_signup','ko','이 예방 접종 알림은 <WEB_NAME&&>에서 10 초 이내에 가입 할 수 있으며 100 % 무료라는 사실을 친구에게 알려주는 유용한 정보라고 생각하십니까?'),('share_others_signup','mr','ही लसीकरण स्मरणपत्रे आपल्या मित्रांसाठीसुद्धा  उपयुक्त असू शकतात असे आपणांस वाटते का? तसे असल्यास त्यांना कळवा की ते १० सेकंदांपेक्षा कमी वेळात <WEB_NAME&&> वर साइनअप करू शकतात आणि ते १००% मोफत आहे.'),('share_others_signup','ms','Jika anda merasa bahawa peringatan vaksinasi ini juga berguna untuk rakan-rakan anda, beritahu mereka bahawa pendaftaran di <WEB_NAME&&> mengambil masa kurang daripada 10 saat dan adalah 100% percuma.'),('share_others_signup','nl','Denk je dat deze vaccinatieherinneringen ook nuttig kunnen zijn voor je vrienden, vertel ze dan dat het nog geen 10 seconden duurt om zich hiervoor aan te melden en dat het 100% gratis is.'),('share_others_signup','no','Tror du at disse vaksinasjonspåminnelsene kan være nyttige også for vennene dine, hvis det er tillfelle, la dem få vite at de kan registrere seg på mindre enn 10 sekunder på <WEB_NAME&&>, og det er 100% gratis.'),('share_others_signup','pl','Czy uważasz, że te przypomnienia o szczepieniach mogą być przydatne także dla twoich znajomych, jeśli tak, daj im znać, że mogą zarejestrować się w mniej niż 10 sekund na <WEB_NAME&&> i jest to w 100% za darmo.'),('share_others_signup','pt','Você acha que estes lembretes de vacinação também podem ser úteis para seus amigos? Se achar que sim, divulgue para que eles possam se inscrever em menos de 10 segundos no <WEB_NAME&&>. É 100% gratuito.'),('share_others_signup','sk','Myslíte si, že tieto pripomenutia očkovania by mohli byť užitočné aj pre vašich priateľov? Ak áno, dajte im vedieť, že na <WEB_NAME&&> sa môžu zaregistrovať za menej než 10 sekúnd a je to 100 % bezplatné.'),('share_others_signup','sv','Tycker du att dessa vaccinationspåminnelser kan vara användbara även för dina vänner? Låt dem i så fall veta att de kan registrera sig på mindre än 10 sekunder på <WEB_NAME&&> och att det är 100% gratis.'),('share_others_signup','ta','இந்த தடுப்பூசி நினைவூட்டல்கள் உங்கள் நண்பர்களுக்கும் பயனுள்ளதாக இருக்கும் என்று நினைக்கிறீர்களா? வெறும் 10 நொடிகளுக்குள் அவர்களால் <WEB_NAME&&> -ல் பதிவு செய்து கொள்ளமுடியும் என்பதையும், இது 100% இலவசமானது என்பதையும் அவர்களுக்கு தெரிவித்திடுங்கள்.'),('share_others_signup','te','ఈ జ్ణాపికలు ఉపయోగపడగల ఇతర స్నేహితులు మీకువున్నారా? అలాగైతే, దయచేసి <WEB_NAME&&> లో సైన్-అప్ అవ్వడం 100% ఉచితం మరియు కేవలం కొన్ని సెకండ్లు పడుతుందని తెలియజేయండీ.'),('share_others_signup','tr','Bu aşı hatırlatmalarının arkadaşlarınız için de faydalı olabileceğini düşünüyor musunuz, eğer öyleyse <WEB_NAME&&> üzerinden tamamen ücretsiz olarak 10 saniyede kaydolmaları için onları da bilgilendirin.'),('share_others_signup','ur','کیا آپ سمجھتے ہیں کہ یہ یاددہانیاں بحوالہ ویکسینیشن آپ کے احباب کے لیے بھی مفید ہو سکتی ہیں؟ اگر ایسا ہے تو انہیں آگاہ کریں کہ وہ 10 سیکنڈز سے بھی کم وقت میں <WEB_NAME&&> میں سائن اپ کر سکتے ہیں اور یہ ٪100 مفت ہے.'),('share_others_signup','vi','Bạn có nghĩ những lời nhắc tiêm phòng này có thể cũng hữu ích với bạn bè của bạn không? Nếu vậy hãy cho họ biết họ có thể đăng ký trong ít hơn 10 giây và hoàn toàn miễn phí tại <WEB_NAME&&>'),('share_others_signup','zh','您觉得这些疫苗接种提醒对您的朋友有用吗？如果您觉得有用，请告诉他们，以便于他们能够在10秒钟之内通过<WEB_NAME&&>注册，完全免费：'),('share_title','ar','شارك:'),('share_title','bg','Дял:'),('share_title','bn','শেয়ার:'),('share_title','ca','Compartir:'),('share_title','cs','Sdílejte:'),('share_title','da','Del:'),('share_title','de','Teilen:'),('share_title','el','Κοινοποίηση:'),('share_title','en','Share:'),('share_title','es','Compartir:'),('share_title','fa','به اشتراک بگذارید:'),('share_title','fi','Jaa:'),('share_title','fr','Partager:'),('share_title','gu','શેર:'),('share_title','he','שתף:'),('share_title','hi','शेयर करें:'),('share_