'mr','हे लसीकरण केवळ <COUNTRY_NAME&&> मधील काही विशिष्ट भागांसाठी किंवा उच्च जोखीम गटासाठी शिफारसित करण्यात आले आहे. आपल्या बाबतीत या लसीची शिफारस केली आहे का हे तपासा.'),('vax_recommended_only','ms','Vaksinasi ini hanya disyorkan untuk beberapa kawasan tertentu di <COUNTRY_NAME&&> atau untuk kumpulan berisiko tinggi. Periksa sama ada vaksinasi ini disyorkan untuk anda.'),('vax_recommended_only','nl','Deze vaccinatie wordt alleen aanbevolen voor een aantal specifieke gebieden in <COUNTRY_NAME&&> of groepen met een hoog risico. Controleer in jouw geval of deze vaccinatie wordt aanbevolen of niet.'),('vax_recommended_only','no','Denne vaksinen anbefales kun for enkelte spesifikke områder i <COUNTRY_NAME&&> eller høyrisikogrupper. Sjekk om denne vaksinen er anbefalt i ditt tilfelle.'),('vax_recommended_only','pl','To szczepienie jest zalecane tylko w niektórych określonych obszarach <COUNTRY_NAME&&> lub grupach wysokiego ryzyka. Sprawdź, czy to szczepienie jest zalecane w twoim przypadku.'),('vax_recommended_only','pt','Esta vacina somente é recomendada para algumas áreas específicas do <COUNTRY_NAME&&> ou em grupos de alto risco. Verifique se está vacina é recomendada no seu caso.'),('vax_recommended_only','sk','Toto očkovanie je odporúčané iba pre niektoré konkrétne oblasti v krajine <COUNTRY_NAME&&> alebo skupiny s vysokým rizikom. Skontrolujte, či je toto očkovanie odporúčané aj vo vašom prípade.'),('vax_recommended_only','sv','Denna vaccination rekommenderas endast för vissa specifika områden i <COUNTRY_NAME&&> eller högriskgrupper. Kontrollera om denna vaccination rekommenderas i ditt fall.'),('vax_recommended_only','ta','இந்த தடுப்பூசி <COUNTRY_NAME&&> -இல் உள்ள குறிப்பிட்ட பகுதிகள் அல்லது உயர் அபாயக் குழுக்களுக்காக மட்டுமே பரிந்துரைக்கப்படுகிறது. உங்கள் வழக்கில் இந்த தடுப்பூசி பரிந்துரைக்கப்படுகிறதா என்று பார்க்கவும்.'),('vax_recommended_only','te','<COUNTRY_NAME&&> లోని ప్రత్యేకమైన ప్రాంతాల కోసం లేదా అధిక పీడిత గుంపులకు అనుగుణంగా టీకాలు సిఫారస్సు చేయబడ్డాయి. మ