ratuit deux semaines avant chaque vaccination.'),('web_intro','gu','ડબ્લ્યુએચઓ દ્વારા તમારા દેશ માટે ભલામણ કરાયેલા તમામ રસીકરણો અને દરેક રસીકરણના બે અઠવાડિયા પહેલાં મફત ઇમેઇલ રિમાઇન્ડર મેળવો.'),('web_intro','he','קבל לו\"ז חיסונים המומלצים על ידי ארגון הבריאות העולמי עבור המדינה שלך, ותזכורת מייל בחינם שבועיים לפני כל חיסון.'),('web_intro','hi','अपने देश के लिए WHO द्वारा अनुशंसित सभी टीकों की एक अनुसूची और प्रत्येक टीके के दो सप्ताह पहले एक निःशुल्क ईमेल रिमाइंडर प्राप्त करें।'),('web_intro','hr','Preuzmite raspored svih cijepljenja koja SZO preporučuje za vašu zemlju i besplatni podsjetnik e-mailom dva tjedna prije svakog cijepljenja.'),('web_intro','hu','Kérjen ütemtervet a WHO által az Ön országában ajánlott védőoltásokról és minden egyes oltás előtt két héttel egy ingyenes emlékeztetőt e-mailben.'),('web_intro','ka','ನಿಮ್ಮ ದೇಶಕ್ಕೆ ವಿಶ್ವ ಆರೋಗ್ಯ ಸಂಸ್ಥೆಯು ಶಿಫಾರಸು ಮಾಡಿದ ಎಲ್ಲಾ ಲಸಿಕೆಗಳ ವೇಳಾಪಟ್ಟಿ ಮತ್ತು ಲಸಿಕೆ ಕೊಡಬೇಕಾದ ದಿನಕ್ಕೆ ಎರಡು ವಾರ ಮುಂಚಿತವಾಗಿ ಉಚಿತ ಇಮೇಲ್ ಜ್ಞಾಪನೆಯನ್ನು ಪಡೆಯಿರಿ.'),('web_intro','ko','귀하의 국가에서 WHO가 권장하는 모든 예방 접종 일정과 각 예방 접종 2 주 전에 무료 이메일 알림을 받으십시오.'),('web_intro','mr','आपल्या देशासाठी WHO द्वारे शिफारस केलेल्या सर्व लसींचे वेळापत्रक आणि प्रत्येक लसीकरणाच्या दोन आठवड्यांपूर्वी एक मोफत ईमेल स्मरणपत्र मिळवा.'),('web_intro','ms','Dapatkan jadual semua suntikan yang disyorkan oleh WHO untuk negara anda dan peringatan e-mel percuma dua minggu sebelum setiap vaksinasi.'),('web_intro','nl','Ontvang een overzicht met alle vaccinaties aanbevolen door de WHO voor jouw land plus een gratis e-mailherinnering twee weken voor elke vaccinatie.'),('web_intro','no','Få en oversikt over alle vaksiner anbefalt av WHO for ditt land og en gratis påminnelse på e-post to uker før hver vaksinasjon.'),('web_intro','pl','Pobierz harmonogram wszystkich szczepień zalecanych przez WHO dla Twojego kraju oraz bezpłatne przypomnienie e-mailem na dwa tygodnie przed każdym szczepieniem.'),('web_intro','pt','Obtenha um cronograma de todas as vacinas recomendadas pela OMS para seu país e alertas gratuitos, enviados por e-mail, 2 semanas antes de cada vacinação.'),('web_intro','sk','Získajte harmonogram všetkých očkovaní odporúčaných Svetovou zdravotníckou organizáciou (WHO) pre svoju krajinu a bezplatné e-mailové upozornenie dva týždne pred každým očkovaním.'),('web_intro','sl','Na voljo vam je razpored vseh cepljenj, ki jih priporoča Svetovna zdravstvena organizacija (WHO) za vašo državo in brezplačni opomnik preko e-pošte, ki ga boste prejeli dva tedna pred vsakim cepljenjem.'),('web_intro','sv','Få schema över alla vaccinationer som rekommenderas av WHO för ditt land och en gratis epostpåminnelse två veckor före varje vaccination.'),('web_intro','ta','உங்கள் நாட்டுக்காக WHO நிறுவனத்தால் பரிந்துரைக்கப்பட்டுள்ள அனைத்து தடுப்பூசிகளின் அட்டவணையைப் பெற்று, தடுப்பூசிக்கு இரண்டு வாரங்களுக்கு முன்பு இலவச மின்னஞ்சல் நினைவூட்டலைப் பெற்றிடுங்கள்.'),('web_intro','te','మీ దేశానికి అనుగుణంగా డబ్ల్యు హెచ్ ఓ సిఫారస్సు చేయబడిన టీకాలన్నిటి పట్టిక పొందండి మరియు ప్రతి టీకా వేయడానికి రెండు వారాల ముందు ఉచిత ఇమెయిల్ ద్వారా జ్ణాపికను పొందండి.'),('web_intro','tr','Ülkeniz için WHO (Dünya Sağlık Örgütü) tarafından önerilen tüm aşıların takvimini ve her aşıdan iki hafta önce ücretsiz e-posta ile hatırlatma alın.'),('web_intro','ur','ہر ویکسینیشن سے دو ہفتے قبل عالمی ادارہ صحت WHO کی طرف سے اپنے ملک سے متعلق تمام سفارش کردہ ویکسینیشنز کا شیڈول اور مفت یاددہانی ای میل وصول کریں.'),('web_intro','vi','Nhận lịch tất cả các mũi tiêm phòng do WHO khuyến cáo cho đất nước của bạn và email miễn phí nhắc bạn hai tuần trước mỗi lần tiêm phòng.'),('web_intro','zh','获取世界卫生组织（WHO）建议在您的国家接种的所有疫苗接种方案，并且在每次接种前两周免费通过电子邮件给您发送提醒邮件。'),('web_meta_description','ar',' احصل على الجدول الزمني لجميع التطعيمات الموصى بها من قبل منظمة الصحة العالمية لبلدك فقط من خلال ادخال تاريخ ميلاد طفلك. يتم إرسال التنبيهات عبر البريد الإلكتروني قبل أسبوعين من كل تطعيم.'),('web_meta_description','ca','Obté un calendari de totes les vacunes recomanades per l\'OMS per al teu país amb només ingressar a la data de naixement del teu fill/-a. Les alertes per correu electrònic s\'envien 2 setmanes abans de cada vacunació programada.'),('web_meta_description','cs','Stačí zadat datum narození a získáte kompletní rozpis všech očkování doporučených WHO pro vaši zemi. Upozornění emailem 2 týdny před každým očkováním.'),('web_meta_description','de','Mit der Eingabe des Geburtsdatums erhalten Sie einen Zeitplan aller Impfungen, die von der WHO für Ihr Land empfohlen werden. E-Mail-Benachrichtigung 2 Wochen vor jeder Impfung.'),('web_meta_description','el','Μπορείς να λάβεις πρόγραμμα όλων των εμβολιασμών που προτείνει ο ΠΟΥ (Παγκόσμιος Οργανισμός Υγείας) για την χώρα σου. Αρκεί να εισάγεις την ημερομηνία γέννησης του παιδιού σου. Θα λαμβάνεις email ειδοποιήσεις μέσω email, δυο εβδομάδες πριν τον κάθε προγραμματισμένο εμβολιασμό.'),('web_meta_description','en','Get a schedule of all vaccinations recommended by the WHO for your country just by entering the date of birth of your child. Email alerts are sent 2 weeks before each scheduled vaccination.'),('web_meta_description','es','Inserta la fecha de nacimiento de tu hijo y consigue el calendario de vacunas recomendadas por la OMS en tu país. Las alertas por email se envían 2 semanas antes de la fecha de la vacuna. '),('web_meta_description','fi','Hanki lista kaikista WHO:n maassasi suosittelemista rokotuksista ilmoittamalla lapsesi syntymäpäivä. Muistutus lähetetään sähköpostitse kaksi viikkoa ennen jokaista rokotusta.'),('web_meta_description','fr','En entrant simplement la date de naissance vous obtenez un calendrier de tous les vaccins recommandés par l\'OMS pour votre pays. Alerte par courriel 2 semaines avant chaque vaccination.'),('web_meta_description','gu','તમારા બાળકના જન્મ તારીખને દાખલ કરીને તમારા દેશ માટે ડબ્લ્યુએચઓ દ્વારા ભલામણ કરાયેલા તમામ રસીકરણનો શેડ્યૂલ મેળવો. ઇમેઇલ ચેતવણીઓ દરેક સુનિશ્ચિત રસીકરણના 2 અઠવાડિયા પહેલા મોકલવામાં આવે છે.'),('web_meta_description','he','ע\"י הזנת תאריך לידה בלבד תוכל לקבל לו\"ז של כל החיסונים המומלצים על ידי ארגון הבריאות העולמי עבור המדינה שלך. התראה שבועיים מראש במייל לפני כל חיסון.'),('web_meta_description','hi','अपने बच्चे की जन्म तिथि प्रवेश करके अपने देश के लिए WHO द्वारा अनुशंसित सभी टीकों की एक अनुसूची और प्रत्येक टीके के दो सप्ताह पहले एक निःशुल्क ईमेल रिमाइंडर प्राप्त करें।'),('web_meta_description','hr','Nabavite raspored svih cijepljenja koje preporučuje SZO za vašu zemlju jednostavnim unošenjem datuma rođenja vašeg djeteta. Upozorenja e-mailom šalju se 2 tjedna prije svakog planiranog cijepljenja.'),('web_meta_description','hu','Mindössze a születési dátum megadásával megkaphatja a WHO által az Ön országában ajánlott védőoltások ütemtervét. Figyelmeztetők emailben 2 héttel az oltások előtt.'),('web_meta_description','ka','ನಿಮ್ಮ ಮಗುವಿನ ಜನನದ ದಿನಾಂಕವನ್ನು ನಮೂದಿಸುವುದರ ಮೂಲಕ ನಿಮ್ಮ ದೇಶಕ್ಕೆ ವಿಶ್ವ ಆರೋಗ್ಯ ಸಂಸ್ಥೆಯು ಸೂಚಿಸಿರುವ ಎಲ್ಲಾ ಲಸಿಕೆಗಳ ವೇಳಾಪಟ್ಟಿಯನ್ನು ಪಡೆಯಿರಿ. ಪ್ರತಿ ನಿಗದಿತ ಲಸಿಕೆಗೆ 2 ವಾರಗಳ ಮೊದಲು ಇಮೇಲ್ ಎಚ್ಚರಿಕೆಗಳನ್ನು ಕಳುಹಿಸಲಾಗುತ್ತದೆ.'),('web_meta_description','ko','출생일을 입력하면 귀하의 국가에서 WHO가 권장하는 모든 예방 접종 일정을 알 수 있습니다. 각 예방 접종 2 주 전에 이메일로 알려주십시오.'),('web_meta_description','mr','केवळ आपल्या पाल्याची जन्मतारीख प्रविष्ट करून आपल्या देशासाठी WHO द्वारे शिफारस केलेल्या सर्व लसींचे वेळापत्रक मिळवा. ईमेल अलर्टस प्रत्येक अनुसूचित लसीकरणाच्या २ आठवडे आधी पाठवले जातात'),('web_meta_description','ms','Anda hanya perlu memasukkan tarikh lahir anda untuk mendapatkan jadual semua suntikan yang disyorkan oleh WHO untuk negara anda. Pemberitahuan e-mel 2 minggu sebelum setiap vaksinasi.'),('web_meta_description','nl','Als je jouw geboortedatum invoert, ontvang je een schema van alle vaccinaties, welke zijn aanbevolen door de WHO van jouw land. E-mailmelding 2 weken voor elke vaccinatie.'),('web_meta_description','no','Legg bare inn fødselsdatoen, så får du en oversikt over alle vaksiner som WHO anbefaler for ditt land. E-postvarsling 2 uker før hver vaksinasjon.'),('web_meta_description','pl','Po wprowadzeniu daty urodzenia otrzymasz harmonogram wszystkich szczepień zalecanych przez WHO dla Twojego kraju. Powiadomienie e-mailem na 2 tygodnie przed każdym szczepieniem.'),('web_meta_description','pt','Obtenha um cronograma de todas as vacinas recomendadas pela OMS para seu país inserindo apenas a data de nascimento de seu filho. Os alertas serão enviados por e-mail 2 semanas antes de cada vacinação agendada.'),('web_meta_description','sk','Získajte harmonogram všetkých očkovaní odporúčaných Svetovou zdravotníckou organizáciou (WHO) pre svoju krajinu. Stačí zadať dátum narodenia vášho dieťaťa. Dva týždne pred každým plánovaným očkovaním dostanete e-mailové upozornenie.'),('web_meta_description','sl','Razpored vseh cepljenj, ki jih priporoča Svetovna zdravstvena organizacija (WHO) za vašo državo, lahko enostavno dobite z vnosom rojstnega datuma vašega otroka. Dva tedna pred vsakim predvidenim cepljenjem boste prejeli opomnike po e-pošti.'),('web_meta_description','sv','Få ett schema över alla rekommenderade vaccinationen som rekommenderas av WHO bara genom att ange födelsedatumet på ditt barn. Epostpåminnelser skickas 2 veckor före varje inplanerad vaccination.'),('web_meta_description','ta','உங்கள் குழந்தையின் பிறந்த தேதியை உள்ளிடுவதன் மூலம், உங்கள் நாட்டுக்காக WHO நிறுவனத்தால் பரிந்துரைக்கப்பட்டுள்ள அனைத்து தடுப்பூசிகளின் அட்டவணையைப் பெற்றிடுங்கள். ஒவ்வொரு தடுப்பூசி அட்டவணையின் 2 வாரங்களுக்கு முன்பு மின்னஞ்சல் நினைவூட்டல்கள் அனுப்பப்படும். '),('web_meta_description','te','కేవలం మీ శిశువు జన్మించిన తేదీతో మీరు మీ దేశానికి అణుగుణంగా Wడబ్ల్యు హెచ్ ఓ సిఫారస్సు చేయబడిన టీకాలన్నిటి పట్టిక పొందండి. ప్రతి టీకా వేయడానికి రెండు వారాల ముందు ఇమెయిల్ జ్ణాపికలను పొందండి.'),('web_meta_description','tr','Sadece doğum gününüzü girerek, ülkeniz için WHO (Dünya Sağlık Örgütü) tarafından önerilen tüm aşıların takvimini alabilirsiniz. Her aşıdan iki hafta önce e-posta ile bildirim yapılır.'),('web_meta_description','ur','اپنے بچے کی تاریخ پیدائش داخل کر کے عالمی ادارہ صحت WHO کی طرف سے اپنے ملک سے متعلق تمام سفارش کردہ ویکسینیشنز کا شیڈول حاصل کریں. ہر شیڈول ویکسینی